// src/components/ActivityHistory.js
import React from 'react';

const ActivityHistory = () => {
  return (
    <div style={{ padding: '20px' }}>
      <h1>Activity History</h1>
      <p>Here you can view your past activities.</p>
    </div>
  );
};

export default ActivityHistory;
